import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Console from "./Components/Console";
import Button from "./Components/Button";
import RadioButton from "./Components/RadioButton";
import Input from "./Components/Input";

const e = React.createElement;
class App extends React.Component {
  constructor(props) {
    super(props);
    this.clearConsole = this.clearConsole.bind(this);
    this.addConsoleValue = this.addConsoleValue.bind(this);
    this.trainingModeAction = this.trainingModeAction.bind(this);
    this.updateEpochs = this.updateEpochs.bind(this);
    this.updateIterations = this.updateIterations(this);

    this.state = {
      console: ["Nothing on console..."],
      epochs: 10,
      iterations: 300,
      mode: "default",
      trainedModel: []
    };
  }

  componentDidMount() {}

  clearConsole() {
    this.setState({
      console: []
    });
  }

  train() {
    const date = new Date();
    this.setState({
      console: [
        ...this.state.console,
        "[" + date.toLocaleTimeString() + "]:Training..."
      ]
    });
  }

  updateIterations(iteration) {
    this.setState({
      iterations: iteration
    });
  }
  updateEpochs(iteration) {
    this.setState({
      iterations: iteration
    });
  }

  trainingModeAction(mode) {
    this.setState({
      mode: mode
    });
  }
  addConsoleValue() {
    const date = new Date();
    this.setState({
      console: [
        ...this.state.console,
        "[" + date.toLocaleTimeString() + "]:Training..."
      ]
    });
  }

  renderMode(mode) {
    switch (mode) {
      default:
        return e(
          "div",
          {},
          <Button label="Train with default dataset" />,
          <Button label="Predict with test dataset" />
        );
      case "custom":
        return e("p", {}, "custom goest here...");
    }
  }

  render() {
    return e(
      "div",
      {
        className: "container",
        style: {
          position: "relative",
          top: 100
        }
      },
      e(
        "div",
        { className: "row" },
        e(
          "div",
          { className: "col-md-6" },
          e("p", null, "Console"),
          <Console console={this.state.console} />,
          <Button label="Add" onClick={this.addConsoleValue} />,
          <Button label="Clear" onClick={this.clearConsole} />
        ),
        e(
          "div",
          { className: "col-md-6" },
          e("p", {}, "Train"),
          e("p", null, "Default Breast Cancer Dataset"),
          e(
            "div",
            { className: "row" },
            e(
              "div",
              { className: "col-md-6" },
              e("p", {}, "Epochs"),
              <Input
                placeholder="Enter here number of epochs"
                value={this.state.epochs}
                updateEpochs = {this.updateEpochs}

              />
            ),
            e(
              "div",
              { className: "col-md-6" },
              e("p", {}, "Iterations"),
              <Input
                placeholder="Enter here number of iterations"
                value={this.state.iterations}
                updateIterations = {this.updateIterations}
              />
            ),
            e(
              "div",
              { className: "col-md-6" },
              <RadioButton
                label="Default dataset train"
                value="default"
                onModeSelection={this.trainingModeAction}
              />
            ),
            e(
              "div",
              { className: "col-md-6" },
              <RadioButton
                label="Custom dataset train"
                value="custom"
                onModeSelection={this.trainingModeAction}
              />
            )
          ),
          this.renderMode(this.state.mode)
        )
      )
    );
  }
}

export default App;
